import base64
import speech_recognition as sr

encoded = 'data:audio/wav;base64,'
header, body = encoded.split(',')
decoded = base64.b64decode(body)

r = sr.Recognizer()
print(1)
audio = sr.AudioData(decoded, 16000, 2)
print(2)
print(audio)
recognized_text = r.recognize_google(audio,language='en-US', show_all=True)

print(f'recognized text: {recognized_text}')